import React from "react";

const Gallery = () => {
  const imgUrl = [
    "../../img/img_gallery/gift.jpg",
    "../../img/img_gallery/inside.jpg",
    "../../img/img_gallery/inside_2.jpg",
    "../../img/img_gallery/mojito.jpg",
    "../../img/img_gallery/steak.jpg",
    "../../img/img_gallery/wine.jpg",
  ];

  const arrangeImg = imgUrl.map((url) => {
    return <img src={url} key={url} />;
  });

  return (
    <div>
      <a href="https://ibb.co/z5SJhTF">
        <img
          src="https://i.ibb.co/SxKrX4c/Processed-with-VSCO-with-c1-preset.jpg"
          alt="Processed-with-VSCO-with-c1-preset"
          border="0"
          width="250px"
        ></img>
      </a>
    </div>
  );
};

export default Gallery;
